import React from 'react';
import { reduxForm, Field } from 'redux-form';

class StreamCreate extends React.Component {
	render() {
		return (
			<form>
				<div className='form-group'>
					<Field component={this.renderInput()} />
					<Field />
				</div>
			</form>
		);
	}
}
export default reduxForm({
	form: 'streamCreate',
})(StreamCreate);
